import {React, useState} from 'react';

function App() {

  const [jsonData, setJsonData] = useState('');

  const handleFetch = event => {
    event.preventDefault();
    fetchBackend();
  };

  const fetchBackend = () => {
    fetch(`/hello`).then(res => res.json()).then(data => {
      setJsonData(data)
    });
  }

  return (
    <div className="App">
      <button onClick={handleFetch}>
        Click me!
      </button>
    {jsonData}
    </div>
  );
}

export default App;
